description:
Compilation of all 14 volumes of Dulce Report plus Phallic Girls in decensored form.


All chapters have been decensored by Blue Moon Circle.The scans are by Dark Nemesis and the translation and editing by SaHa with the exception of the first two chapters of Phallic Girls


